import { React, useState } from "react";
import TextField from "@mui/material/TextField";

import "./navbar.css";

function Search() {
  return (
    <div className="main">
      <h1>React Search</h1>
      <div className="search">
        <TextField
          id="outlined-basic"
          variant="outlined"
          fullWidth
          label="Search"
        />
      </div>
        <button onClick={handleSubmit} className="btn" type="submit">
          <h3>Submit</h3>
        </button>
    </div>
  );
}

export default Search;
